import { Component, ViewChild, OnInit } from '@angular/core';

import { AppTabs } from './shared/app-tabs.enum';
import { ApproveComponent } from './approve/approve.component';
import { MediaService } from './shared/media.service';
import { Media } from './shared/media';
import { MediaType } from './shared/media-type.enum';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent implements OnInit {
  constructor(private mediaService: MediaService) {}

  @ViewChild(ApproveComponent) approve: ApproveComponent;

  b64Images: string[] = [
    // region image
    // tslint:disable-next-line:max-line-length
    'data:image/jpeg;base64,',
    // endregion
    // region image
    // tslint:disable-next-line:max-line-length
    'data:image/jpeg;base64,',
    // #endregion
    // region image
    // tslint:disable-next-line:max-line-length
    'data:image/png;base64,',
    // endregion
    // region image
    // tslint:disable-next-line:max-line-length
    'data:image/png;base64,',
    // endregion
    // region image
    // tslint:disable-next-line:max-line-length
    'data:image/jpeg;base64,'
    // endregion
  ];

  ngOnInit(): void {
    this.b64Images.forEach(i => {
      this.mediaService.create(<Media>{
        type: MediaType.Image,
        data: i,
        timeStamp: new Date()
      });
    });
    console.log(this.mediaService.getAll());
  }

  onTabChange(e) {
    if (e.index === AppTabs.Approve) {
      this.approve.updateMedia();
    }
  }
}
